@npr - a news organization funded by your tax dollars - released a hit piece targeting @realDailyWire as they seek to label everything they don't like as “misinformation.” They're coming for freedom of the press. And they're not hiding the ball.

The idea here is that Facebook and social media companies have centralized distribution of information; Democrats and the establishment media wish to restore their monopoly on informational dissemination by pressuring Facebook to do their bidding.

Bottom line: Subscribe to informational outlets you like. All of them, from Daily Wire to The Blaze to Fox Nation. Because the Left is going to try to suppress them, and they're not being subtle about it. Use code: "DefundNPR" at my link in bio to join DW for 25% off. #DefundNPR
